import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';


@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css'],
})
export class HomeComponent implements OnInit {

  nomeProduto: string = 'Curso Angular';
  idProduto: number = 1;
  precoProduto: number = 122.5;
  promocao: boolean = false;
  foto: string = 'assets/img/Angular.png';
  dataValidade = '2023-07-28';

  nomeProduto2: string = 'Curso JavaScript';
  idProduto2: number = 2;
  precoProduto2: number = 115.9;
  promocao2: boolean = true;
  foto2: string = 'assets/img/cursoJS.jpg_large';
  dataValidade2 = '2023-07-14';

  nomeProduto3: string = 'Curso Figma 2.0     ';
  idProduto3: number = 3;
  precoProduto3: number = 145.9;
  promocao3: boolean = false;
  foto3: string = 'assets/img/figma.jpg';
  dataValidade3 = '2023-07-09';

  nomeProduto4: string = 'Curso HTML + CSS';
  idProduto4: number = 4;
  precoProduto4: number = 199.9;
  promocao4: boolean = false;
  foto4: string = 'assets/img/htmlcss.jpg';
  dataValidade4 = '2023-07-21';

  nomeProduto5: string = 'Curso Flutter 2.0      ';
  idProduto5: number = 5;
  precoProduto5: number = 149.9;
  promocao5: boolean = false;
  foto5: string = 'assets/img/flutter.png';
  dataValidade5 = '2023-08-11';

  nomeProduto6: string = 'Curso React Native';
  idProduto6: number = 6;
  precoProduto6: number = 129.9;
  promocao6: boolean = true;
  foto6: string = 'assets/img/resctnative.png';
  dataValidade6 = '2023-08-02';

  listaProdutos: any[] = [
    {
      nome: 'Curso Angular',
      precoProduto: 122.5,
      validade: '2023-07-28',
      id: 1,
    }
  ];

  constructor() {}

  ngOnInit(): void {}

}
<h1 class="text-center text-danger mt-2">Seja bem vindo!</h1>

<div class="row">
  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="produto.foto"
      [nomeProduto]="produto.nome"
      [promocao]="produto.promocao"
      [idProduto]="produto.id"
      [dataValidade]="produto.validade"
      [precoProduto]="produto.precoProduto"

    >
    </app-card-produto>
  </div>


  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="foto2"
      [nomeProduto]="nomeProduto2"
      [promocao]="promocao2"
      [idProduto]="idProduto2"
      [dataValidade]="dataValidade2"
      [precoProduto]="precoProduto2"

    >
    </app-card-produto>
  </div>
  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="foto3"
      [nomeProduto]="nomeProduto3"
      [promocao]="promocao3"
      [idProduto]="idProduto3"
      [dataValidade]="dataValidade3"
      [precoProduto]="precoProduto3"

    >
    </app-card-produto>
  </div>
  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="foto4"
      [nomeProduto]="nomeProduto4"
      [promocao]="promocao4"
      [idProduto]="idProduto4"
      [dataValidade]="dataValidade4"
      [precoProduto]="precoProduto4"

    >
    </app-card-produto>
  </div>
  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="foto5"
      [nomeProduto]="nomeProduto5"
      [promocao]="promocao5"
      [idProduto]="idProduto5"
      [dataValidade]="dataValidade5"
      [precoProduto]="precoProduto5"

    >
    </app-card-produto>
  </div>
  <div class="col" *ngFor="let produto of listaProdutos">
    <app-card-produto
      [foto]="foto6"
      [nomeProduto]="nomeProduto6"
      [promocao]="promocao6"
      [idProduto]="idProduto6"
      [dataValidade]="dataValidade6"
      [precoProduto]="precoProduto6"

    >
    </app-card-produto>
  </div>
</div>
